import React, { useState, useEffect } from "react";
import axios from "../utils/apiClient";

const ScheduleList = () => {
  const [schedules, setSchedules] = useState([]);

  useEffect(() => {
    // Fetch schedules from the backend
    const fetchSchedules = async () => {
      try {
        const response = await axios.get("/schedules");
        setSchedules(response.data);
      } catch (error) {
        console.error("Error fetching schedules:", error);
      }
    };

    fetchSchedules();
  }, []);

  return (
    <div>
      <h2>Course Schedules</h2>
      <table>
        <thead>
          <tr>
            <th>Schedule ID</th>
            <th>Course Name</th>
            <th>Course Time</th>
            <th>Course Day</th>
            <th>Room</th>
            <th>Building</th>
          </tr>
        </thead>
        <tbody>
          {schedules.map((schedule) => (
            <tr key={schedule.courseScheduleId}>
              <td>{schedule.courseScheduleId}</td>
              <td>{schedule.course ? schedule.course.courseName : "N/A"}</td>
              <td>{schedule.courseTime}</td>
              <td>{schedule.courseDay}</td>
              <td>{schedule.room}</td>
              <td>{schedule.building}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default ScheduleList;
